theme.css:
.quote {
    font-family: Lato, Prelo, Prelo Slab;
    font-size: 24px;
    font-weight: 400;
    color: #303030;
    text-align: center;
    background: url(https://s3.amazonaws.com/infogram-themes/17611/quote.svg) center top no-repeat;
    padding: 65px 20px 0 20px;
}
.ig-share-button {
    margin-top: 1px;
}
.quotetitle {
    font-family: Lato;
    font-size: 15px;
    font-weight: 400;
    color: #e30613;
    text-align: center;
    margin-top: 10px;
}
.quote .innertext {
    line-height: 30px;
}
.quote .quotetitle .innertext {
    line-height: 22px;
}
/* igc-pie:start */
svg .igc-semi-pie-center-text .igc-pie-center-text-node,
svg .igc-pie-center-text .igc-pie-center-text-node {
    font-family: Lato;
    font-size: 24px;
    font-weight: 400;
    fill: #303030;
}
/* igc-pie:end */

/*igc-textual:start*/
.igc-textual-figure {
    font-family: Lato;
    font-size: 24px;
    font-weight: 400;
}
.igc-textual-text.innertext {
    line-height: 30px;
}
.igc-textual-fact {
    color: #303030;
    font-family: Lato;
    font-size: 15px;
    font-weight: 400;
}
.innertext .igc-textual-fact {
    line-height: 22px;
}
.igc-textual-icon {
    padding-right: 30px;
    padding-top: 7px;
}
/*igc-textual:end*/

.igc-table .igc-table-cell {
    font-family: Lato;
    font-size: 13px;
    font-weight: 400;
}
.igc-table .igc-table-header {
    font-family: Lato;
    font-size: 13px;
    font-weight: 400;
    padding-left: 9px;
}
.ig-container {
    background: #fff;
}
.ig-copyright {
    display: none;
}
.headline {
    font-family: Lato;
    font-size: 35px;
    font-weight: 700;
    color: #303030;
    text-align: center;
    border-bottom: none; padding-bottom: 0;;
}
.headline .innertext {
    line-height: 42px;
}
.chart-title {
    font-family: Lato;
    font-size: 24px;
    font-weight: 400;
    color: #303030;
    text-align: center;
}
.chart-title .innertext {
    line-height: 30px;
}
.bodytext {
    font-family: Lato;
    font-size: 15px;
    font-weight: 400;
    color: #303030;
    text-align: left;
    line-height: 22px;

}
.tt_tooltip {
    color: #FFF;
    font-family: Lato;
    font-size: 15px;
    font-weight: 400;
}
.tt_tooltip .tt_value {
    font-weight: 400;
}
.tt_tooltip .tt_body {
    background: #333;
}
.tt_tooltip .tt_left {
    border-right: 8px solid #333;
}
.tt_tooltip .tt_right {
    border-left: 8px solid #333;
}

.igc-legend-entry {
    margin-top: 15px;
}
.igc-legend {
    padding-top: 10px;
    padding-bottom: 0;
}

.footer-bottom {
    border-top: 0px,solid,#dadada;
    padding-top: 15px;
    overflow: hidden;
    margin-bottom: 15px;
}

.ig-separator-line {
    background: rgba(227,6,19,0.7);
}
.heatmap-legend {
	background: rgba(255,255,255,0.7);
}
.heatmap-legend-item,
.heatmap-label {
 	color: #303030;
	font-size: 13px;
	font-weight: 400;
	font-family: Lato;
}
.igc-graph-pie-piece {
	stroke: rgba(255,255,255,0.7);
}


.captiontext {
    font-family: Lato;
    color: #303030;
    font-size: 13px;
    font-weight: 400;
}
.captiontext .innertext {
    line-height: 1.5;
}

.igc-table-search {
    color: #e30613;
    font-size: 13px;
    font-weight: 400;
    font-family: Lato;
}
